    for(int i = 1; i <= n; ++i){
        cin >> a[i];
        if(a[i] > t)
            t = a[i], ti = i;
    }
    bool flag = true;
    l = ti-1, r = ti+1;
    while(1){
        if(r > n && l < 1){
            break;
        }else if(r > n){
            if(a[l] < a[ti])
                ti = l, --l;
            else{
                flag = false;
                break;
            }
        }else if(l < 1){
            if(a[r] < a[ti])
                ti = r, ++r;
            else{
                flag = false;
