inline ll add(ll a, ll b, ll m) { return (((a % m + b % m) % m + m) % m); }
inline ll mul(ll a, ll b, ll m) { return (((a % m * b % m) % m + m) % m); }

void solve()
{
	int n;
	cin >> n;
	v32 arr(n, 0);
	for (int i = 0; i < n; i++)
		cin >> arr[i];
	sort(arr.begin(), arr.end());
	int lim = min(arr[n - 1], arr[n - 2]);
	arr.pop_back();
	arr.pop_back();
	int ans = 0;
	for (int x : arr)
	{
		if (x >= 1 && ans + 1 < lim)
			ans++;
	}
	cout << ans << ln;
	return;
}

