ll lcm(ll val1,ll val2)
{
	if(val1==0||val2==0)
		return 0;
	else
		return (val1*val2)/__gcd(val1,val2);
}

ll pw(ll base,ll p)
{
	if(base==1||p==0)				
		return 1;
	if(p%2==0){
		ll interm=pw(base,p/2);
		return interm*interm;

	}
	else
		return base*pw(base,p-1);

}

