			if ((l & 1) == 0)ret += dat[l];
			if ((r & 1) == 0)ret += dat[r - 1];
			l = l / 2;
			r = (r - 1) / 2;
		}
		return ret;
	}
};
class RmqTree {
private:

	ll _find(ll a, ll b, ll k, ll l, ll r) {
		if (r <= a || b <= l)return INF;    // äº¤å·®ã—ãªã„
		if (a <= l && r <= b)return dat[k];   // a,l,r,bã®é †ã§å®Œå…¨ã«å«ã¾ã‚Œã‚‹
		else {
			ll s1 = _find(a, b, 2 * k + 1, l, (l + r) / 2); // å·¦ã®å­
			ll s2 = _find(a, b, 2 * k + 2, (l + r) / 2, r); // å³ã®å­
			return min(s1, s2);
		}
	}
public:
	ll n, height;
	vector<ll> dat;

	// åˆæœŸåŒ–ï¼ˆ_nã¯æœ€å¤§è¦ç´ æ•°ï¼‰
	RmqTree(ll _n) {
		n = 1;
		height = 1;
		while (n < _n) {
			n *= 2;
			height++;
		}
		dat = vector<ll>(2 * n - 1, INF);
	}

	// å ´æ‰€i(0-indexed)ã‚’xã«ã™ã‚‹
	void update(ll i, ll x) {
		i += n - 1; // iç•ªç›®ã®è‘‰ãƒŽãƒ¼ãƒ‰ã¸
		dat[i] = x;
		while (i > 0) { // ä¸‹ã‹ã‚‰ä¸ŠãŒã£ã¦ã„ã
			i = (i - 1) / 2;
			dat[i] = min(dat[i * 2 + 1], dat[i * 2 + 2]);
		}
	}

	// åŒºé–“[a,b)ã®æœ€å°å€¤ã€‚ãƒŽãƒ¼ãƒ‰k=[l,r)ã«ç€ç›®ã—ã¦ã„ã‚‹ã€‚
	ll find(ll a, ll b) {
		return _find(a, b, 0, 0, n);
	}
};


//ç´„æ•°æ±‚ã‚ã‚‹ //ç´„æ•°
void divisor(ll n, vector<ll>& ret) {
	for (ll i = 1; i * i <= n; i++) {
		if (n % i == 0) {
			ret.push_back(i);
			if (i * i != n) ret.push_back(n / i);
		}
	}
	sort(ret.begin(), ret.end());
}

void prime_factorization(ll n, vector<P>& ret) {
	for (ll i = 2; i * i <= n; i++) {
		if (n % i == 0) {
			ret.push_back({ i,0 });
			while (n % i == 0) {
				n /= i;
				ret[ret.size() - 1].second++;
			}
		}
	}
	if (n != 1)ret.push_back({ n,1 });
}


ll mod_pow(ll x, ll n, ll mod) {
	ll res = 1;
while (n > 0) {
	if (n & 1) res = res * x % mod;
	x = x * x % mod;
	n >>= 1;
}
return res;
}

ll mod_inv(ll x, ll mod) {
	return mod_pow(x, mod - 2, mod);
}
//nCrã¨ã‹
class Combination {
public:
	Array fact;
	Array inv;
	ll mod;
	ll mod_inv(ll x) {
		ll n = mod - 2LL;
		ll res = 1LL;
		while (n > 0) {
			if (n & 1) res = res * x % mod;
			x = x * x % mod;
			n >>= 1;
		}
		return res;
	}
	//if n >= mod use lucas 
	ll nCr(ll n, ll r) {
		if (n < r)return 0;
		if (n < mod)return ((fact[n] * inv[r] % mod) * inv[n - r]) % mod;

		ll ret = 1;
		while (n || r) {
			ll _n = n % mod, _r = r % mod;
			n /= mod; r /= mod;
			(ret *= nCr(_n, _r)) %= mod;
		}
		return ret;
	}
	ll nPr(ll n, ll r) {
		return (fact[n] * inv[n - r]) % mod;
	}
	ll nHr(ll n, ll r) {
		return nCr(r + n - 1, r);
	}
	Combination(ll _n, ll _mod) {
		mod = _mod;
		ll n = min(_n + 1, mod);
		fact.resize(n);
		fact[0] = 1;
		REP(i, n - 1) {
			fact[i + 1] = (fact[i] * (i + 1LL)) % mod;
		}
		inv.resize(n);
		inv[n - 1] = mod_inv(fact[n - 1]);
		for (int i = n - 1; i > 0; i--) {
			inv[i - 1] = inv[i] * i % mod;
		}
	}
};

ll popcount(ll x) {
	x = (x & 0x5555555555555555) + (x >> 1 & 0x5555555555555555);
	x = (x & 0x3333333333333333) + (x >> 2 & 0x3333333333333333);
	x = (x & 0x0F0F0F0F0F0F0F0F) + (x >> 4 & 0x0F0F0F0F0F0F0F0F);
	x = (x & 0x00FF00FF00FF00FF) + (x >> 8 & 0x00FF00FF00FF00FF);
	x = (x & 0x0000FFFF0000FFFF) + (x >> 16 & 0x0000FFFF0000FFFF);
	x = (x & 0x00000000FFFFFFFF) + (x >> 32 & 0x00000000FFFFFFFF);

	return x;
}




int main() {
